create table france (
PRODUCT_DESC	VARCHAR2(250 Byte),
FORM_DESC	VARCHAR2(250 Byte),
DOSAGE	VARCHAR2(100 Byte),
DOSAGE_ADD	VARCHAR2(100 Byte),
VOLUME	VARCHAR2(100 Byte),
PACKSIZE	VARCHAR2(100 Byte),
CLAATC	VARCHAR2(100 Byte),
PFC	VARCHAR2(100 Byte),
MOLECULE	VARCHAR2(450 Byte),
CD_NFC_3	VARCHAR2(250 Byte),
ENGLISH	VARCHAR2(250 Byte),
LB_NFC_3	VARCHAR2(250 Byte),
DESCR_PCK	VARCHAR2(250 Byte),
STRG_UNIT	VARCHAR2(100 Byte),
STRG_MEAS	VARCHAR2(100 Byte)
)
;
WbImport -file=C:/mapping/France/FRDA.txt
         -type=text
         -table=FRANCE
         -encoding=Big5
         -header=true
         -decode=false
         -dateFormat="yyyy-MM-dd"
         -timestampFormat="yyyy-MM-dd HH:mm:ss"
         -delimiter='\t'
         -decimal=.
         -fileColumns=ROW_NUM,PRODUCT_DESC,FORM_DESC,DOSAGE,DOSAGE_ADD,VOLUME,PACKSIZE,CLAATC,PFC,MOLECULE,CD_NFC_3,ENGLISH,LB_NFC_3,DESCR_PCK,STRG_UNIT,STRG_MEAS
         -quoteCharEscaping=none
         -ignoreIdentityColumns=false
         -deleteTarget=true
         -continueOnError=false;
--delete duplicate values from source table and 'Non Human Usage Products', choose 
delete from france a where exists (
select 1 from (select max(row_num) as row_num, pfc from france where pfc in (
select pfc from france group by pfc having count (1) >1)
group by pfc ) b where a.pfc = b.pfc and a.row_num = b.row_num
)
;
--creating non-drug table
create table non_drugs
(
